import React from 'react';
import { Box, Button, Typography, Grid, Card } from '@mui/material';
import { Link, useNavigate } from 'react-router-dom';

const Header = ({ setIsLoggedIn }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Clear login state
    setIsLoggedIn(false);
    // Redirect to login page
    navigate("/login");
  };

  // Function to get random position within the parent container
  const getRandomPosition = () => {
    const top = Math.floor(Math.random() * 60) + 'vh';  // Random position between 0 and 60% of the height
    const left = Math.floor(Math.random() * 60) + 'vw';  // Random position between 0 and 60% of the width
    return { top, left };
  };

  return (
    <Box sx={{ padding: 4, display: 'flex', flexDirection: 'column', height: '100vh' }}>
      {/* Header Section with Logout Button */}
      <Grid container spacing={4} justifyContent="center" sx={{ flex: 1, position: 'relative' }}>

        {/* Deposit Money Box */}
        <Grid item style={{ position: 'absolute', ...getRandomPosition() }}>
          <Card
            sx={{
              width: 200,
              height: 200,
              display: 'flex',
              flexDirection: 'column',
              justifyContent: 'center',
              alignItems: 'center',
              backgroundColor: '#f5f5f5',
              boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
              borderRadius: '10px',
              transition: 'all 0.3s ease',
              '&:hover': {
                boxShadow: '0 12px 20px rgba(0, 0, 0, 0.2)',
                transform: 'scale(1.05)',
              }
            }}
          >
            <Link to="/deposit" style={{ textDecoration: 'none', width: '100%' }}>
              <Typography
                variant="h6"
                sx={{
                  color: '#333',
                  fontWeight: 'bold',
                  textAlign: 'center',
                  padding: '0 0 20px 0',
                  fontSize: '20px',
                }}
              >
                Deposit Money
              </Typography>
            </Link>
            <Typography
              variant="body2"
              sx={{
                color: '#333',
                fontStyle: 'italic',
                textAlign: 'center',
                fontSize: '14px',
                marginBottom: '10px',
              }}
            >
              Mewo Bank
            </Typography>
          </Card>
        </Grid>

        {/* Withdraw Box */}
        <Grid item style={{ position: 'absolute', ...getRandomPosition() }}>
          <Card
            sx={{
              width: 200,
              height: 200,
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              backgroundColor: '#f5f5f5',
              boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
              borderRadius: '10px',
              transition: 'all 0.3s ease',
              '&:hover': {
                boxShadow: '0 12px 20px rgba(0, 0, 0, 0.2)',
                transform: 'scale(1.05)',
              }
            }}
          >
            <Link to="/withdraw" style={{ textDecoration: 'none' }}>
              <Typography variant="h6" sx={{ color: '#333', fontWeight: 'bold' }}>
                Withdraw
              </Typography>
            </Link>
          </Card>
        </Grid>

        {/* Transfer Money Box */}
        <Grid item style={{ position: 'absolute', ...getRandomPosition() }}>
          <Card
            sx={{
              width: 200,
              height: 200,
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              backgroundColor: '#f5f5f5',
              boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
              borderRadius: '10px',
              transition: 'all 0.3s ease',
              '&:hover': {
                boxShadow: '0 12px 20px rgba(0, 0, 0, 0.2)',
                transform: 'scale(1.05)',
              }
            }}
          >
            <Link to="/transfer" style={{ textDecoration: 'none' }}>
              <Typography variant="h6" sx={{ color: '#333', fontWeight: 'bold' }}>
                Transfer Money
              </Typography>
            </Link>
          </Card>
        </Grid>

        {/* Check Balance Box */}
        <Grid item style={{ position: 'absolute', ...getRandomPosition() }}>
          <Card
            sx={{
              width: 200,
              height: 200,
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              backgroundColor: '#f5f5f5',
              boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
              borderRadius: '10px',
              transition: 'all 0.3s ease',
              '&:hover': {
                boxShadow: '0 12px 20px rgba(0, 0, 0, 0.2)',
                transform: 'scale(1.05)',
              }
            }}
          >
            <Link to="/check-balance" style={{ textDecoration: 'none' }}>
              <Typography variant="h6" sx={{ color: '#333', fontWeight: 'bold' }}>
                Check Balance
              </Typography>
            </Link>
          </Card>
        </Grid>

        {/* Additional Card can be added here, similar to above */}

      </Grid>

      {/* Logout Button at the Bottom */}
      <Button 
        variant="contained" 
        color="secondary" 
        onClick={handleLogout} 
        sx={{ marginTop: 'auto' }}
      >
        Logout
      </Button>
    </Box>
  );
};

export default Header;
